$(document).ready(function() {
  var d = new Date();
  var month = ["January","February","March","April","May","June","July","August","September","October","November","December"];
  var txt;
  var person = prompt("Please enter your full name:");
  if (person == null || person == "") {
      txt = "no name person...";
      person = "anonymous";
  } else {
      txt = person + "!";
  }
  $("#name").html(txt);
  $('#button').click(function() {

    var doc = new jsPDF({
      orientation: 'landscape',
      unit: 'in',
      format: [11, 8.5]
    })
    var imgData='data:image/jpeg;base64,';

    doc.addFont('Quantico-Regular.ttf', 'Quantico', 'normal');
    doc.addImage(imgData, 'JPEG',0,0,11,8.5);

    doc.setFont('Quantico');
		doc.setFontSize(11);
		doc.setTextColor(0, 0, 0);

		doc.text(5.9372, 3.1996, person, 'center');
    doc.text(5.9372, 3.7003, month[d.getMonth()]+' '+d.getDate()+', '+d.getFullYear(), 'center');
		doc.save('test.pdf');

	});
});
